import React from 'react'
import MaterialTable, { MTableToolbar } from 'material-table';

const headCells = [
    { title: 'name', field: 'name', id: 'name', numeric: false, disablePadding: true, title: 'Dessert (100g serving)' },
    { title: 'calories', field: 'calories', id: 'calories', numeric: true, disablePadding: false, title: 'Calories' },
    { title: 'fat', field: 'fat', id: 'fat', numeric: true, disablePadding: false, title: 'Fat (g)' },
    { title: 'carbs', field: 'carbs', id: 'carbs', numeric: true, disablePadding: false, title: 'Carbs (g)' },
    { title: 'protein', field: 'protein', id: 'protein', numeric: true, disablePadding: false, title: 'Protein (g)' },
];

function createData(name, calories, fat, carbs, protein) {
    return { name:name, calories: calories, fat: fat, carbs: carbs, protein:protein };
}

const rows = [
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Donut', 452, 25.0, 51, 4.9),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
    createData('Honeycomb', 408, 3.2, 87, 6.5),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Jelly Bean', 375, 0.0, 94, 0.0),
    createData('KitKat', 518, 26.0, 65, 7.0),
    createData('Lollipop', 392, 0.2, 98, 0.0),
    createData('Marshmallow', 318, 0, 81, 2.0),
    createData('Nougat', 360, 19.0, 9, 37.0),
    createData('Oreo', 437, 18.0, 63, 4.0),
];

export default function RenderImage() {
    return (
        <MaterialTable
            title="Render Image Preview"
            // columns={[
            //     { title: 'Avatar', field: 'imageUrl', render: rowData => <img src={rowData.imageUrl} style={{ width: 40, borderRadius: '50%' }} /> },
            //     { title: 'Name', field: 'name' },
            //     { title: 'Surname', field: 'surname' },
            //     { title: 'Birth Year', field: 'birthYear', type: 'numeric' },
            //     {
            //         title: 'Birth Place',
            //         field: 'birthCity',
            //         lookup: { 34: 'İstanbul', 63: 'Şanlıurfa' },
            //     },
            // ]}
            // data={[
            //     { name: 'Mehmet', surname: 'Baran', birthYear: 1987, birthCity: 63, imageUrl: 'https://avatars0.githubusercontent.com/u/7895451?s=460&v=4' },
            //     { name: 'Zerya Betül', surname: 'Baran', birthYear: 2017, birthCity: 34, imageUrl: 'https://avatars0.githubusercontent.com/u/7895451?s=460&v=4' },
            // ]}
            columns={headCells}
            data={rows}
        />
    )
}
